package com.example.entity;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Table;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Entity@Table(name = "attach")@Data@NoArgsConstructor@AllArgsConstructorpublic class AttachEntity extends BaseStringEntity {    @Column    private String originalName;    @Column    private String path;    @Column    private Long size;    @Column    private String extension;}